import React from "react";
import "./Program.css";
// import "../../App.css";

function Program(){
    return(
        <div className="programs" id="programs">
        <span className="stroke-text" >Hi</span>
            {/* Header */}
            <div className="headers">
                <span className="stroke-text">Explore Our</span>
                <span>programs</span>
                <span>To Shape You</span>
            </div>
        </div>
    );
}
export default Program;
